import { describe, expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
describe('resDelay', () => {
    test('ok', async () => {
        let now = Date.now();
        await request('http://resdelay.test.whistlejs.com/');
        now = Date.now() - now;
        expect(now).toBeGreaterThan(1000);
    });
});
